import React, {Component} from "react";

class CardClip extends Component {

    render() {
        return (
            <div className="scene">
                <div className="card">
                    <div className="card__face card__face--front">{this.props.name}</div>
                    <div className="card__face card__face--back">back</div>
                </div>
            </div>
        )
    }
}

export default CardClip
